import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Home.css";

export default function Home() {
  const [fullName, setFullName] = useState("");
  const [email, setEmail] = useState("");
  const [numQ, setNumQ] = useState(10);
  const navigate = useNavigate();

  const handleStart = () => {
    if (!fullName.trim() || !email.trim()) {
      return alert("Please enter your full name and email.");
    }
    navigate("/test", { state: { fullName, email, numQ } });
  };

  return (
    <div className="home-container">
      <div className="home-grid">
        {/* LEFT CARD */}
        <div className="home-card banner-card">
          <h2>VLSI<br />Interview<br />Assessment</h2>
          <p>
            Test your knowledge of <strong>Very Large Scale Integration (VLSI)</strong> concepts and gauge your readiness for interviews.
          </p>
        </div>

        {/* CENTER CARD */}
        <div className="home-card form-card">
          <h4 className="form-title">Start Your Interview Test</h4>
          <p className="text-muted">
            You will be presented with randomly selected questions. Please answer to the best of your ability.
          </p>

          <div className="form-group">
            <label>Full Name *</label>
            <input
              type="text"
              placeholder="Enter your full name"
              value={fullName}
              onChange={(e) => setFullName(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label>Email Address *</label>
            <input
              type="email"
              placeholder="Enter your email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label>Number of Questions</label>
            <select value={numQ} onChange={(e) => setNumQ(Number(e.target.value))}>
              <option value={5}>5 Questions</option>
              <option value={10}>10 Questions</option>
            <option value={20}>20 Questions</option>
            <option value={30}>30 Questions</option>
            <option value={10}>10 Questions</option>

            </select>
          </div>

          <button className="btn-start" onClick={handleStart}>
            Start Test
          </button>
        </div>

        {/* RIGHT CARD */}
        <div className="home-card instruction-card">
          <h5>Instructions</h5>
          <ul>
            <li>Read each question carefully before answering.</li>
            <li>Use <strong>Next</strong> and <strong>Previous</strong> to navigate.</li>
            <li>Submit once all questions are answered.</li>
            <li>Your test results will be recorded automatically.</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

